import React from 'react';

import { 
  HeaderContainer
} from 'carbon-components-react';

const LandingPage = () => {
  return <div>
    <HeaderContainer max width="sm"style = {{backgroundColor:"green"}}>
            <h1>LANDING PAGE This is to check|||  Are we good+++</h1>
    </HeaderContainer>
    </div>;

};

export default LandingPage;
